    @RequestMapping(value = "/insert/{count}/{batch}", method = GET)
    @ResponseBody
    String insert(@PathVariable("count") int count, @PathVariable("batch") int batch) {
        long starttime = System.currentTimeMillis();
        int i = 0;
        Connection c = null;
        Statement stmt = null;
        for (int j = 0; j < count; j++) {
            try {
                Class.forName("org.postgresql.Driver");
                c = DriverManager
                        .getConnection("jdbc:postgresql://54.152.140.72:5432/testdb",
                                "dbuser1", "welcome1");
                c.setAutoCommit(false);
                System.out.println("Opened database successfully");

                String uuid;

                stmt = c.createStatement();

                do {
                    uuid = UUID.randomUUID().toString();
                    String sql = "INSERT INTO clickstreamdata (eventid,tenantid,eventtext) "
                            + "VALUES ('" + uuid + "','" + uuid + "','" + Events[random.nextInt(Events.length)] + "' );";
                    stmt.executeUpdate(sql);
                    i++;

                } while (--batch > 0);
                System.out.print("Commiting..");
                stmt.close();
                c.commit();
                c.close();
            } catch (Exception e) {
                System.err.println(e.getClass().getName() + ": " + e.getMessage());
                System.exit(0);
            }
        }
        String ret = String.format("%d inserts took %dms", i, System.currentTimeMillis() - starttime);
        System.out.print(ret);
        return ret;
    }

